import React, { useState } from 'react';
import {
  ChevronRight,
  BarChart3,
  Brain,
  Home,
  LayoutDashboard,
  ScatterChart,
  Columns,
  PieChart,
  LineChart,
  Map
} from 'lucide-react';
import axios from 'axios';

const App = () => {
  const [currentPage, setCurrentPage] = useState('home');
  const [selectedVisualization, setSelectedVisualization] = useState(null);

  // Crop Price Prediction state
  const [formData, setFormData] = useState({
    state: '',
    district: '',
    crop: '',
    production: '',
    zn: '',
    fe: ''
  });
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Handle input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Submit form to backend
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPrediction(null);
    setError('');

    try {
      const response = await axios.post('http://127.0.0.1:8000/predict', {
        state: formData.state,
        district: formData.district,
        crop: formData.crop,
        production: parseFloat(formData.production),
        zn: parseFloat(formData.zn),
        fe: parseFloat(formData.fe)
      });
      if (response.data.error) {
        setError(response.data.error);
      } else {
        setPrediction(response.data);
      }
    } catch (err) {
      setError('Server error. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  // Power BI visualizations (same as your code)
  const visualizations = [
    // ... keep your visualization objects here
  ];

  // HomePage and VisualizationsPage remain unchanged

  const ModelsPage = () => (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-indigo-900 to-slate-900 p-6">
      <div className="max-w-4xl mx-auto">
        <button
          onClick={() => setCurrentPage('home')}
          className="inline-flex items-center text-purple-400 hover:text-purple-300 transition-colors duration-200 mb-4"
        >
          <Home className="w-4 h-4 mr-2" /> Back to Home
        </button>
        <h1 className="text-4xl md:text-5xl font-bold text-white mb-4">
          Crop Price Prediction
        </h1>
        <p className="text-gray-300 text-lg mb-6">
          Enter crop details and soil parameters to predict the modal price.
        </p>

        <form
          className="bg-white/10 backdrop-blur-lg rounded-2xl border border-white/20 p-6 grid grid-cols-1 md:grid-cols-2 gap-4"
          onSubmit={handleSubmit}
        >
          <input
            type="text"
            name="state"
            placeholder="State"
            value={formData.state}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            required
          />
          <input
            type="text"
            name="district"
            placeholder="District"
            value={formData.district}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            required
          />
          <input
            type="text"
            name="crop"
            placeholder="Crop"
            value={formData.crop}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            required
          />
          <input
            type="number"
            name="production"
            placeholder="Production (tonnes)"
            value={formData.production}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            step="any"
            required
          />
          <input
            type="number"
            name="zn"
            placeholder="Zinc (Zn)"
            value={formData.zn}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            step="any"
            required
          />
          <input
            type="number"
            name="fe"
            placeholder="Iron (Fe)"
            value={formData.fe}
            onChange={handleChange}
            className="p-3 rounded-lg bg-white/20 border border-white/30 text-white placeholder-white focus:outline-none"
            step="any"
            required
          />
          <button
            type="submit"
            className="col-span-full bg-purple-500 hover:bg-purple-600 text-white font-bold py-3 rounded-lg transition-colors duration-200"
          >
            {loading ? 'Predicting...' : 'Predict Price'}
          </button>
        </form>

        {error && (
          <div className="mt-6 text-red-400 font-semibold text-center">{error}</div>
        )}

        {prediction && (
          <div className="mt-6 bg-white/10 backdrop-blur-lg border border-white/20 rounded-2xl p-6 text-center text-white">
            <h2 className="text-2xl font-bold mb-4">Prediction Result</h2>
            <p>₹{prediction.price_per_quintal} per Quintal</p>
            <p>₹{prediction.price_per_kg} per Kg</p>
            <p>₹{prediction.price_per_tonne} per Tonne</p>
          </div>
        )}
      </div>
    </div>
  );

  return (
    <div className="font-sans">
      {currentPage === 'home' && <HomePage />}
      {currentPage === 'visualizations' && <VisualizationsPage />}
      {currentPage === 'models' && <ModelsPage />}
    </div>
  );
};

export default App;
